import React, { Component } from 'react';

class Skills extends Component {
    constructor(props) {
        super()
        this.state = {
            "width": "300px"
        }
    }
    render() {
        return (
            <React.Fragment>
                <div className='container-fluid'>
                    <hr />
                    <h2 className='display-4'>My Skills</h2>
                    <hr />

                    {/* Python */}
                    <div class="card m-2" style={this.state}>
                        <img class="card-img" src="https://cdn.dribbble.com/users/1103017/screenshots/4307976/ad-01-.jpg?compress=1&resize=400x300" alt="python logo" />
                        <div class="card-img-overlay text-white">
                            <h2 class="card-title">Python</h2>
                        </div>
                    </div>

                    {/* C */}
                    <div class="card m-2" style={this.state}>
                        <img class="card-img" src="https://cdn.dribbble.com/users/1103017/screenshots/4307976/ad-01-.jpg?compress=1&resize=400x300" alt="python logo" />
                        <div class="card-img-overlay text-white">
                            <h2 class="card-title">C</h2>
                        </div>
                    </div>

                </div>
            </React.Fragment>
        );
    }
}

export default Skills;
